object.script:
--- This whole script is for the Right bar gauge
function onTick()
	Input2 = input.getNumber(2)

	Green1 = {0,131,49}
	Green2 = {0,158,29}
	Green3 = {0,226,50}
	Yellow1 = {255,231,39}
	Orange1 = {255,165,2}
	Orange2 = {255,127,39}
	Red1 = {255,0,49}


	scC = {Green1, Green1, Green2, Green2, Green3, Green3, Yellow1, Yellow1, Orange1, Orange1, Orange2, Orange2, Red1 ,Red1}


	segmenttb = {"","","","","","","","","","","","","",""}

end	
	function gFix(r,g,b)
		r=r^2.2/255^2.2*r
		g=g^2.2/255^2.2*g
		b=b^2.2/255^2.2*b
		return r,g,b
	end

	function mainfunction(input)
		for i = 1,14,1 do
			if input > 0.071428*i then
				segmenttb[i] = true
			end
		end
	end

	function mk2(input)	
		for i = 14,1,-1 do
			screen.setColor(10,10,10)
			screen.drawRectF(17,30-i*2,13,1)
			if input > 0.071428*i then
			screen.setColor(gFix(table.unpack(scC[i])))
			screen.drawRectF(17,30-i*2,13,1) 
			end                                                           
		end
	end


function onDraw()

	w = screen.getWidth()
	h = screen.getHeight()						
	mk2(Input2)

end
